import React, { useEffect, useState } from "react";

export function AdminDashboard() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    fetch("http://localhost:5000/users")
      .then(res => res.json())
      .then(data => setUsers(data))
      .catch(err => console.log(err));
  }, []);

  const admin = JSON.parse(localStorage.getItem("user"));
  if (!admin || admin.email !== "admin@veridia.com") {
    return <h2>Access Denied</h2>;
  }

  const updateStatus = async (userId, appIndex, status) => {
    try {
      const res = await fetch(`http://localhost:5000/users/${userId}/application/${appIndex}/status`, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ status })
      });
      const result = await res.json();
      if (result.success) {
        alert(result.message);
        const updatedUsers = await fetch("http://localhost:5000/users").then(res => res.json());
        setUsers(updatedUsers);
      } else {
        alert("❌ " + result.message);
      }
    } catch (err) {
      alert("❌ Error: " + err.message);
    }
  };

  return (
    <div className="container">
      <h1>Admin Dashboard</h1>
      {users.map(user => (
        <div key={user._id} style={{ border: "1px solid gray", padding: "10px", margin: "10px 0" }}>
          <h3>{user.name} ({user.email})</h3>
          {user.applications.length === 0 ? (
            <p>No applications submitted yet</p>
          ) : (
            user.applications.map((app, i) => (
              <div key={i} style={{ border: "1px dashed gray", padding: "10px", margin: "10px 0" }}>
                <p><strong>Education:</strong> {app.education}</p>
                <p><strong>College:</strong> {app.collegeName}</p>
                <p><strong>Proficiency (Language):</strong> {app.proficiency}</p>
                <p><strong>Skills:</strong> {app.skills.join(", ")}</p>
                <p><strong>Experience:</strong> {app.experience} years</p>
                <p><strong>Projects:</strong> {app.projects}</p>
                <p>
                  <strong>Resume:</strong>{" "}
                  {app.resumeLink ? (
                    <a href={`http://localhost:5000${app.resumeLink}`} target="_blank" rel="noreferrer">
                      View / Download
                    </a>
                  ) : "Not uploaded"}
                </p>
                <p>
                  <strong>Website Link:</strong>{" "}
                  {app.websiteLink ? (
                    <a href={app.websiteLink} target="_blank" rel="noreferrer">{app.websiteLink}</a>
                  ) : "N/A"}
                </p>
                <p><strong>Status:</strong> {app.status}</p>
                <button onClick={() => updateStatus(user._id, i, "Accepted")} style={{ marginRight: "10px" }}>Accept</button>
                <button onClick={() => updateStatus(user._id, i, "Rejected")}>Reject</button>
              </div>
            ))
          )}
        </div>
      ))}
    </div>
  );
}
